Similarly, for headhunting companies, the distance \( d(v_{ij}^{\delta}, e_j^{\delta}) \) between the actual value \( v_{ij}^{\delta} \) and the expected value \( e_j^{\delta} \) of headhunting company \( \delta_j \) to enterprise \( \partial_i \) is calculated as:

\[
\gamma_{ij}^{\partial}(u_{ij}^{\partial}, e_i^{\partial}) = 
\begin{cases}
d(u_{ij}^{\partial}, e_i^{\partial}), & u_{ij}^{\partial} \geq e_i^{\partial} \\
-d(u_{ij}^{\partial}, e_i^{\partial}), & u_{ij}^{\partial} < e_i^{\partial}
\end{cases}
\tag{5}
\]

\[
\gamma_{ij}^{\delta}(v_{ij}^{\delta}, e_j^{\delta}) = 
\begin{cases}
d(v_{ij}^{\delta}, e_j^{\delta}), & v_{ij}^{\delta} \geq e_j^{\delta} \\
-d(v_{ij}^{\delta}, e_j^{\delta}), & v_{ij}^{\delta} < e_j^{\delta}
\end{cases}
\tag{9}
\]

\[
\psi_{ij}^{\partial}(u_{ij}^{\partial}, e_i^{\partial}) =
\begin{cases}
\left( \gamma_{ij}^{\partial}(u_{ij}^{\partial}, e_i^{\partial}) \right)^a, & u_{ij}^{\partial} \geq e_i^{\partial} \\
- \lambda \left( -\gamma_{ij}^{\partial}(u_{ij}^{\partial}, e_i^{\partial}) \right)^b, & u_{ij}^{\partial} < e_i^{\partial}
\end{cases}
\tag{6}
\]

\[
d(v_{ij}^{\delta}, e_j^{\delta}) = \sum_{x=1}^{|v_{ij}^{\delta}|} \sum_{y=1}^{|e_j^{\delta}|} \left| (p_{v_{ij}^{\delta}}^x \times p_{e_j^{\delta}}^y) \left( g(L_{v_{ij}^{\delta}}^x) - g(L_{e_j^{\delta}}^y) \right) \right|
\tag{8}
\]

where \(0 < a < 1, 0 < b < 1, \lambda > 1\). The coefficient \(\lambda\) reflects the psychological behavior of two-sided subjects, and all subjects are more sensitive to loss compared with profit. The greater the coefficient \(\lambda\) is, the greater the degree of loss avoidance is. According to the idea of Ruggeri et al. (2020), the values of coefficients are determined, i.e., \(a = b = 0.88\), \(\lambda = 2.25\). By Eq. (6), the prospect value matrix \(K^{\partial} = [\psi_{ij}^{\partial}]_{m \times n}\) of enterprises to headhunting companies is constructed.

\[
\psi_{ij}^{\delta}(v_{ij}^{\delta}, e_j^{\delta}) = 
\begin{cases}
\left( \gamma_{ij}^{\delta}(v_{ij}^{\delta}, e_j^{\delta}) \right)^a, & v_{ij}^{\delta} \geq e_j^{\delta} \\
- \lambda \left( -\gamma_{ij}^{\delta}(v_{ij}^{\delta}, e_j^{\delta}) \right)^b, & v_{ij}^{\delta} < e_j^{\delta}
\end{cases}
\tag{10}
\]

\[
\alpha_{ij}^{\partial} = \frac{
\psi_{ij}^{\partial} - \min\limits_{i \in H, j \in T} \left\{ \psi_{ij}^{\partial} \right\} + \frac{1}{m} \max\limits_{i \in H, j \in T} \left\{ \psi_{ij}^{\partial} \right\}
}{
\frac{m+1}{m} \max\limits_{i \in H, j \in T} \left\{ \psi_{ij}^{\partial} \right\} - \min\limits_{i \in H, j \in T} \left\{ \psi_{ij}^{\partial} \right\}
}, \quad i \in H, j \in T
\tag{7}
\]

\[
\beta_{ij}^{\delta} = \frac{
\psi_{ij}^{\delta} - \min\limits_{i \in H, j \in T} \left\{ \psi_{ij}^{\delta} \right\} + \frac{1}{n} \max\limits_{i \in H, j \in T} \left\{ \psi_{ij}^{\delta} \right\}
}{
\frac{n+1}{n} \max\limits_{i \in H, j \in T} \left\{ \psi_{ij}^{\delta} \right\} - \min\limits_{i \in H, j \in T} \left\{ \psi_{ij}^{\delta} \right\}
}, \quad i \in H, j \in T
\tag{11}
\]

\[
\begin{aligned}
\text{(M-1)} \quad
&\text{MaxD}_1 = \sum_{i=1}^m \sum_{j=1}^n \alpha_{ij}^{\partial} x_{ij} \\
&\text{MaxD}_2 = \sum_{i=1}^m \sum_{j=1}^n \beta_{ij}^{\delta} x_{ij} \\
&\text{s.t.} \quad \sum_{j=1}^n x_{ij} \leq m_i, \quad i \in H \\
&\qquad\; \sum_{i=1}^m x_{ij} \leq n_j, \quad j \in T \\
&\qquad\; x_{ij} \in \{0,1\}, \; i \in H, j \in T
\end{aligned}
\]

